import React from "react";
import Navbar from "../Components/Navbar/Nav";
import ProfileImage from "../images/profile";


function HomePage() {
    return (
        <div>
            <Navbar />
            <div className="main-div">
                <img src={ProfileImage} alt="cats"></img>
            </div>
        </div>
    )
}

export default HomePage;
